;jQuery(document).ready(function($){
	//cache some jQuery objects
	var modalTrigger = $('.cd-modal-trigger'),
		transitionLayer = $('.cd-transition-layer'),
		transitionBackground = transitionLayer.children(),
		modalWindow = $('.cd-modal');

	var frameProportion = 1.78, //png frame aspect ratio
		frames = 25, //number of png frames
		resize = false;

	//set transitionBackground dimentions
	setLayerDimensions();
	$(window).on('resize', function(){
		if( !resize ) {
			resize = true;
			(!window.requestAnimationFrame) ? setTimeout(setLayerDimensions, 300) : window.requestAnimationFrame(setLayerDimensions);
		}
	});

	//open modal window
	modalTrigger.on('click', function(event){	
		event.preventDefault();
		transitionLayer.addClass('visible opening');
		var delay = ( $('.no-cssanimations').length > 0 ) ? 0 : 600;
		setTimeout(function(){
			modalWindow.addClass('visible');
		}, delay);
	});

	//close modal window
	modalWindow.on('click', '.modal-close', function(event){
		event.preventDefault();
		transitionLayer.addClass('closing');
		modalWindow.removeClass('visible');
		transitionBackground.one('webkitAnimationEnd oanimationend msAnimationEnd animationend', function(){
			transitionLayer.removeClass('closing opening visible');
			transitionBackground.off('webkitAnimationEnd oanimationend msAnimationEnd animationend');
		});
	});

	function setLayerDimensions() {
		var windowWidth = $(window).width(),
			windowHeight = $(window).height(),
			layerHeight, layerWidth;

		if( windowWidth/windowHeight > frameProportion ) {
			layerWidth = windowWidth;
			layerHeight = layerWidth/frameProportion;
		} else {
			layerHeight = windowHeight*1.2;
			layerWidth = layerHeight*frameProportion;
		}

		transitionBackground.css({
			'width': layerWidth*frames+'px',
			'height': layerHeight+'px',
		});

		resize = false;
	}
});
;// Document ready
$(function(){    

    // Flickity carousel plugin
    $('.main-carousel').flickity({
        // options
        cellAlign: 'left',
        wrapAround: true,
        resize: true
    });   

    // Hide fullscreen nav and hover active states
    $('.overlay ul li a').click( function(){
        hideNav();
    });

    // Back to the top button
    $('#back-to-top').click( function(){
        $('html, body').animate({ scrollTop: $('body').offset().top}, 300);
    });

    // Bind a click event to anything with the class 'toggle-nav'
    $('.hamburger').click(function() {  
        // Toggle the Body Class 'show-nav'
        $('body').toggleClass('show-nav');
        $('#nav-icon').toggleClass('open');
        // Hide social sharing on nav open 
        $('#share-me').removeClass('go');
        $('#share-me').addClass('goAway');
        $('.overlay ul li.overlay-share').toggleClass('show-hide');
        // Deactivate the default behavior of going to the next page on click
        return false;
    });

    // Fit text plugin
    $('#intro-content h1, #case-study-custom h1').fitText(1, { minFontSize: '20px',  maxFontSize: '50px'});

    // Remove from DOM mobile BG video on main navigation 
    if (isMobile()) {
        $('#space-video').remove();
    }
}); // End of Document ready


// Document on scroll change nav state
$(document).on('scroll',function(){

    // If scroll top is 400 + show hide intro paragraph
    if($(document).scrollTop() > 400) {
        // Hide social sharing on nav open 
        $('#share-me').removeClass('go');
        $('#share-me').addClass('goAway');
    }

    // 
    if($(document).scrollTop() > 100) {
            $('#back-to-top').fadeIn().addClass('buttonTopPulse');
        } else {
            $('#back-to-top').fadeOut().removeClass('buttonTopPulse');
    } 
});

// Toggle with hitting of ESC
$(document).keyup(function(e) {
    if (e.keyCode === 27) {
        $('body').toggleClass('show-nav');
        $('#nav-icon, .overlay').toggleClass('open');
    } 
});

function hideNav() {
    $('body').toggleClass('show-nav');
    $('#nav-icon, .overlay').toggleClass('open');
    $('.overlay ul li').removeClass('active');
    $(this).parent().addClass('active');    
}

// Initialisation
var canvasDiv = document.getElementById('particle-canvas');

var options = {
    particleColor: '#FFF',
    interactive: true,
    speed: 'high',
    density: 'high'
};

if( $('body').hasClass('page-case-study') ) {
    var particleCanvas = new ParticleNetwork(canvasDiv, options);    
}

function isMobile() {
    return /Android|webOS|iPad|iPhone|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent);
}